import React from 'react';
import { motion } from 'framer-motion';
import { Users, ShoppingCart, TrendingUp, Table } from 'lucide-react';
import styled from 'styled-components';

const StatsContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 20px;
  margin-bottom: 24px;
`;

const StatCard = styled(motion.div)`
  background: rgba(255, 255, 255, 0.95);
  backdrop-filter: blur(20px);
  border-radius: 16px;
  padding: 24px;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.1);
  border: 1px solid rgba(255, 255, 255, 0.2);
  position: relative;
  overflow: hidden;
`;

const StatIcon = styled.div`
  width: 60px;
  height: 60px;
  border-radius: 12px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 16px;
  background: ${props => props.bgColor};
  color: white;
`;

const StatValue = styled.h3`
  font-size: 2rem;
  font-weight: 700;
  color: #374151;
  margin: 0 0 8px 0;
`;

const StatLabel = styled.p`
  color: #6b7280;
  font-size: 0.875rem;
  margin: 0;
  text-transform: uppercase;
  letter-spacing: 0.05em;
`;

const StatChange = styled.div`
  display: flex;
  align-items: center;
  gap: 4px;
  margin-top: 8px;
  font-size: 0.875rem;
  color: ${props => (props.positive ? '#10b981' : '#ef4444')};
`;

const BackgroundPattern = styled.div`
  position: absolute;
  top: -20px;
  right: -20px;
  width: 100px;
  height: 100px;
  background: ${props => props.bgColor};
  opacity: 0.1;
  border-radius: 50%;
`;

const StatsCards = ({ stats }) => {
  if (!stats) return null;

  const statCards = [
    {
      icon: <Users size={24} />,
      label: 'Total Customers',
      value: stats?.total_customers?.toLocaleString?.() || '0',
      change: '+12%',
      positive: true,
      bgColor: 'linear-gradient(135deg, #3b82f6 0%, #1d4ed8 100%)',
    },
    {
      icon: <ShoppingCart size={24} />,
      label: 'Total Products',
      value: stats?.total_products?.toLocaleString?.() || '0',
      change: '+8%',
      positive: true,
      bgColor: 'linear-gradient(135deg, #10b981 0%, #059669 100%)',
    },
    {
      icon: <TrendingUp size={24} />,
      label: 'Total Transactions',
      value: stats?.total_transactions?.toLocaleString?.() || '0',
      change: '+15%',
      positive: true,
      bgColor: 'linear-gradient(135deg, #f59e0b 0%, #d97706 100%)',
    },
    {
      icon: <Table size={24} />,
      label: 'Rows',
      value: stats?.rows?.toLocaleString?.() || '0',
      change: '+5%',
      positive: true,
      bgColor: 'linear-gradient(135deg, #8b5cf6 0%, #7c3aed 100%)',
    },
    {
      icon: <Table size={24} />,
      label: 'Columns',
      value: stats?.columns?.toLocaleString?.() || '0',
      change: '+3%',
      positive: true,
      bgColor: 'linear-gradient(135deg, #ec4899 0%, #db2777 100%)',
    },
  ];

  return (
    <StatsContainer>
      {statCards.map((stat, index) => (
        <StatCard
          key={index}
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: index * 0.1 }}
          whileHover={{ y: -5 }}
        >
          <BackgroundPattern bgColor={stat.bgColor} />
          <StatIcon bgColor={stat.bgColor}>{stat.icon}</StatIcon>
          <StatValue>{stat.value}</StatValue>
          <StatLabel>{stat.label}</StatLabel>
          <StatChange positive={stat.positive}>
            <TrendingUp size={16} />
            {stat.change}
          </StatChange>
        </StatCard>
      ))}
    </StatsContainer>
  );
};

export default StatsCards;
